export default function NavigationItem(props) {
    return (
        <li className="li-nav-item">
            <a href={props.navItem.link}>
                <i className={props.navItem.icon}></i>
                &nbsp;&nbsp;
                {props.navItem.linkText}
            </a>
        </li>
    )
}
